import React from 'react';
import "../../css/Components/header.css"

 class Header extends React.Component {
    render() {
      return (
            <div id="header">
                <div id="headerBlock">
                    <div>
                      Logo
                    </div>
                    <div id="titleBlock">
                      <p id="titleTxt">Le Jeu de Piste</p>
                    </div>
                    <div>
                      Menu Hamburger
                    </div>
                </div>
            </div>
      )
    }
  }

  export default Header
